import { EllipsisOutlined } from "@ant-design/icons"
import {
  LightFilter,
  ProFormDatePicker,
  ProTable
} from "@ant-design/pro-components"
import { Button } from "antd"

const tableListDataSource = [
    
]




const columns = [
    {
        title: "Index",
        dataIndex: "index",
        render: _ => <a>{_}</a>
      },
  {
    title: "Name",
    dataIndex: "name",
    render: _ => <a>{_}</a>
  },
  {
    title: "Day of birth",
    dataIndex: "dob",
    align: "right",
    sorter: (a, b) => a.containers - b.containers
  },
  
  {
    title: "Action",
    key: "option",
    width: 120,
    valueType: "option",
    render: () => [
      <a key="edit">Edit</a>,
      <a key="delete">Delete</a>,
    ]
  }
]

function Student()  {
  return (
    <ProTable
      columns={columns}
      request={(params, sorter, filter) => {
        // 表单搜索项会从 params 传入，传递给后端接口。
        console.log(params, sorter, filter)
        return Promise.resolve({
          data: tableListDataSource,
          success: true
        })
      }}
      toolbar={{
        search: {
            placeholder: 'Search in here',
          onSearch: value => {
            alert(value)
          }
        },
        // filter: (
        //   <LightFilter>
        //     <ProFormDatePicker name="startdate" label="响应日期" />
        //   </LightFilter>
        // ),
        actions: [
          <Button
            key="primary"
            type="primary"
            onClick={() => {
              alert("add")
            }}  
          >
            Add
          </Button>
        ]
      }}
      rowKey="key"
      search={false}
      dateFormatter="string"
      
    />
  )
}
export default  Student
